          <section className = "one">
            <h1> First Page </h1>
            <img class="girlWalk" src={walkingLoop} alt="girl" />
          </section>

          <section className = "two">
            <h1> Second Page </h1>
          </section>

          <section className = "three">
            <h1> Third Page </h1>
          </section>

          <section className = "four">
            <h1> Fourth Page </h1>
          </section>

        </div>

      </header>
    </div>
  );
}

export default App;
